import React, { useEffect, useState } from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css"
import { Hapiee } from "./Signup";
import { list } from "./Yash";



export const Veedu=()=>
{
    const[tmpArray,setTmpArray]=useState([])
    const[tempArray,settempArray]=useState([])

    const hoi=()=>
    {
        settempArray(Hapiee())
    }

    const hello=()=>{
        setTmpArray(list())
    }
    // useEffect(()=>
    // {
    //     hello()
    // },[])

    // useEffect(()=>{
    //     hello()
    // },[])

    return(
        <>
        <button className="btn btn-info" onClick={hello}>view</button>
        <br/>
        <button className="btn btn-success" onClick={hoi}>Create new signup</button>

        <div className="row justify-content-center">
                        <div className="table-responsive-md">
                            <table className="col-lg-8 col-md-10 col-sm-12 table table-striped p-3 shadow rounded">
                                <thead>
                                    <tr>
                                        <th>User Name</th>
                                        <th>User Age</th>
                                        <th>User Salary</th>
                                        <th>User Place </th>
                                        <th>User Skills</th>
                                    </tr>
                                </thead>
                                <tbody>
                                    {tmpArray.map((ele)=>(
                                        <tr>
                                            <td>{ele.Fname}</td>
                                            <td>{ele.Young}</td>
                                            <td>{ele.Sal}</td>
                                            <td>{ele.City1}</td>
                                            <td>{ele.Yes}</td>
                                        </tr>
                                    ))}
                                </tbody>
                            </table>
                        </div>
                    </div>
        </>
    )
}
